import axios from "axios";
const URL = 'http://localhost:5000/api/ticket/'

const getNotes = async (ticketId, token) => {
  const config = {
    headers: {
      authorization: 'Bearer ' + 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjY0OTNmYTZmNGQ0Nzk1YTI2ZjRkNzA5ZCIsImlhdCI6MTY4ODA5Mjk3NSwiZXhwIjoxNjg4MDk2NTc1fQ.BvG2LOqLnZNrjzdVuioulS3xrmNEM9CaNq9iYe7PQ1w'
    }
  }

  const res = await axios.get(URL + '649a3ebdf60c497539ae0f00' + '/note', config)
  console.log(res.data)
  return res.data
}

const addNote = async (ticketId, note, token) => {
  const config = {
    headers: {
      authorization: 'Bearer ' + token
    }
  }
  console.log(ticketId, note)
  const res = await axios.post(URL + ticketId + '/note/', {text: note}, config)
  return res.data
}

const noteService = {
  getNotes,
  addNote
}

export default noteService
